import React, { useEffect, useState } from "react";
import fetchData from "./fetchData";
import "./country.css";
import card from "../../components/cardGallary";

const Countries = ({ callback }) => {
  const [data, setData] = useState([]);

  useEffect(() => {
    async function gettingTheData() {
      const theData = await fetchData();
      console.log(theData);
      setData([...theData]);
    }
    gettingTheData();
  }, []);

  return (
    <div className="all-countries-card-layout">
      {data.length > 0 &&
        data.map((message) => <Card message={message} callback={callback} />)}
    </div>
  );
};

export default Countries;
